import { Component, OnInit, ViewEncapsulation } from '@angular/core';
import { vrInfo } from 'src/vrInfo';
import { HEADSETS } from '../../mock-vrInfo';

@Component({
  selector: 'app-vrinfo',
  templateUrl: './vrinfo.component.html',
  styleUrls: ['./vrinfo.component.css']
})
export class VRInfoComponent implements OnInit {

  headsetsList = HEADSETS; 

  imagePathQuest3: string = 'assets/images/metaquest3.png';
  imagePathQuest3Grey: string = 'assets/images/metaquest3_grey.png';
  imagePath: string = 'assets/images/downloadAsset.png';
  imagePath-play: string = 'assets/images/downloadAsset.png';

  ngOnInit(): void {
  }

  sendOSC() {
    fetch("http://localhost:3000/VRHeadsets");
    //http://localhost:3000/DownloadAssets/VR1
  }

}
